import React from 'react';
import { FaMapMarkerAlt, FaPhoneAlt, FaEnvelope } from "react-icons/fa";

const ContactUs = () => {
  return (
    <>
      <section className="bg-[#0B3159] py-7 px-6">
        {/* Section Heading */}
        <div className="text-center mb-12">
          <h2 className="text-3xl md:text-4xl font-semibold text-[#F4F7FC] uppercase tracking-wide">
            Contact Us
          </h2>
          <div className="w-16 h-1 bg-[#E5A24A] mx-auto mt-2"></div>
        </div>

        {/* Contact Form and Details Section */}
        <div className="max-w-7xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-8">
          {/* Left Side: Contact Form */}
          <div className="bg-white p-6 rounded-xl shadow-md">
            <form className="space-y-4">
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                <input type="text" placeholder="Name" className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0B3159]" />
                <input type="email" placeholder="E-mail" className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0B3159]" />
              </div>
              <input type="text" placeholder="Subject" className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0B3159]" />
              <textarea placeholder="Message" className="w-full p-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-[#0B3159] h-32"></textarea>
              <button type="submit" className="w-full bg-[#5B2C90] text-white py-3 rounded-lg font-semibold hover:bg-[#4A1F75] transition duration-300">
                Send Message
              </button>
            </form>
          </div>

          {/* Right Side: Contact Details */}
          <div className="space-y-6">
            {/* Phone */}
            <div className="flex items-center space-x-4 bg-white p-6 rounded-xl shadow-md">
              <FaPhoneAlt className="text-[#5B2C90] text-3xl" />
              <div>
                <h3 className="text-lg font-semibold text-[#0B3159]">Call Us</h3>
                <p className="text-gray-600">+91 9929146888</p>
                <p className="text-gray-600">+91 8560972212</p>
              </div>
            </div>

            {/* Email */}
            <div className="flex items-center space-x-4 bg-white p-6 rounded-xl shadow-md">
              <FaEnvelope className="text-[#5B2C90] text-3xl" />
              <div>
                <h3 className="text-lg font-semibold text-[#0B3159]">Message</h3>
                <p className="text-gray-600">yourva@unfirstassistant.com</p>
              </div>
            </div>

            {/* Address */}
            <div className="flex items-start space-x-4 bg-white p-6 rounded-xl shadow-md">
              <FaMapMarkerAlt className="text-[#5B2C90] text-3xl mt-1" />
              <div>
                <h3 className="text-lg font-semibold text-[#0B3159]">Our Location</h3>
                <p className="text-gray-600"><strong>Registered Address:</strong> R.H.B. Colony, 4/411 Sector 14, Udaipur, Rajasthan 313002</p>
                <p className="text-gray-600"><strong>HQ Office:</strong> Plot Number 25, Main Road, Shakti Nagar, Udaipur, Rajasthan 313001</p>
                <p className="text-gray-600"><strong>Canada Office:</strong> 1735 Riverbrook Crescent, Mississauga, L5M6A1, Ontario, Canada</p>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default ContactUs;
